import React from "react";
import "./PromoVideo.scss";

const PromoVideo = () => {
  return (
    <div className="promocontainer relative mt-20">
      <div className="bg-darkgreen absolute h-full w-full top-0 opacity-60 z-1"></div>
      <div className="flex justify-center  z-10">
        <div className="z-10">
          <p className="text-white">PROMO VIDEO</p>
        </div>
        <video className="z-10" width="320" height="240" controls>
          <source src="vid/alevid1.mov" type="video/mp4" />
        </video>
      </div>
    </div>
  );
};

export default PromoVideo;
